	/**
	 * String,(agctn,n),,ut
	 * @param s
	 * @return
	 */
	public static String format(String s){
		s=s.toLowerCase();
		s=s.replace('u', 't');
		StringBuffer sb = new StringBuffer(s);
		
		for(int i=0;i<sb.length();i++){
			switch(sb.charAt(i)){
			case 'a': break;
			case 'c': break;
			case 'g': break;
			case 't': break;
			case 'n':break;
			default: sb=sb.replace(i, i+1, "n");
			}
		}
		
		
		return(sb.toString());
	}
